PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?author WHERE {
  <https://dblp.org/rec/conf/icapr/WangL05> dblp:authoredBy ?author .
  FILTER ( ?author IN ( <https://dblp.org/pid/l/GrahamLeedham> , <https://dblp.org/pid/w/LingyuWang2> ) )
}

