PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT DISTINCT ?venue WHERE {
  ?pub dblp:authoredBy ?author .
  ?pub dblp:publishedInStream ?venue .
  FILTER ( ?pub != <https://dblp.org/rec/conf/fgcn/ChenZXSS08> ) FILTER ( ?author IN ( <https://dblp.org/pid/19/2932-1> , <https://dblp.org/pid/236/3060> , <https://dblp.org/pid/40/4160> , <https://dblp.org/pid/40/4731> , <https://dblp.org/pid/55/2484-1> ) )
}

