PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX foaf: <http://xmlns.com/foaf/0.1/>
SELECT DISTINCT ?coauthor ?coauthorName WHERE {
  ?pub dblp:authoredBy <https://dblp.org/pid/286/6829> ; dblp:authoredBy ?coauthor ; dblp:yearOfPublication ?year .
  FILTER ( ?year >= "2022" ^^ xsd:gYear ) FILTER ( ?coauthor != <https://dblp.org/pid/286/6829> ) OPTIONAL {
    ?coauthor foaf:name ?coauthorName
  }
}

