PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?title ?year WHERE {
  VALUES ?title {
    "Graphics and Security: Exploring Visual Biometrics" "OOElala: order-of-evaluation based alias analysis for compiler optimization"
  }
  ?pub dblp:title ?title .
  ?pub dblp:year ?year .
}
