PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ( AVG( ?paperCount ) AS ?averagePapersPerYear ) WHERE {
  {
    SELECT ?year ( COUNT( ?paper ) AS ?paperCount ) WHERE {
      {
        ?paper dblp:createdBy <https://dblp.org/pid/45/1135> .
        ?paper dblp:yearOfPublication ?year .
      } UNION {
        ?paper dblp:authoredBy <https://dblp.org/pid/45/1135> .
        ?paper dblp:yearOfPublication ?year .
      } UNION {
        ?paper dblp:signatureCreator <https://dblp.org/pid/45/1135> .
        ?paper dblp:yearOfPublication ?year .
      }
    }
    GROUP BY ?year
  }
}

