PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?publication ?title WHERE {
  ?publication dblp:creatorName ?authorName .
  FILTER ( CONTAINS( LCASE( ?authorName ) , "chu k. loo" ) ) ?publication dblp:journal ?journal .
