  }
}

PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX schema: <http://schema.org/>
PREFIX dc: <http://purl.org/dc/elements/1.1/>
PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?publication ?title WHERE {
  ?publication dblp:publishedInStream <https://dblp.org/streams/conf/hpc2> ; dblp:yearOfPublication "2003" ^^ xsd:gYear .
  OPTIONAL {
    ?publication dc:title ?title .
  }
  OPTIONAL {
    ?publication rdfs:label ?title .
  }
  OPTIONAL {
    ?publication schema:name ?title .
  }
  OPTIONAL {
    ?publication dblp:title ?title .
  }
  FILTER ( CONTAINS( LCASE( str( ?title ) ) , "overlay multicast" ) )
}

